import React, { Component } from 'react';

class Add extends Component {
  render() {
    return (
      <div>
        <input type='text' placeholder='Habit' onChange={this.props.onChange} />
        <button onClick={this.props.onAdd}>Add</button>
      </div>
    );
  }
}

export default Add;
